import{_ as l,o as e,c as i,ag as r}from"./chunks/framework.DEqXEGcv.js";const t="/screenshots/OCCP5010.png",h="/screenshots/OCCP24930.png",o="/screenshots/OCCP54870.png",n="/screenshots/OCCP59860.png",s="/screenshots/OCCP5020.png",P=JSON.parse('{"title":"조회관리","description":"","frontmatter":{},"headers":[],"relativePath":"occp/inquiry.md","filePath":"occp/inquiry.md","lastUpdated":null}'),c={name:"occp/inquiry.md"};function u(d,a,p,q,b,m){return e(),i("div",null,[...a[0]||(a[0]=[r('<h1 id="조회관리" tabindex="-1">조회관리 <a class="header-anchor" href="#조회관리" aria-label="Permalink to &quot;조회관리&quot;">​</a></h1><blockquote><p><strong>메뉴 경로</strong>: 입주자 &gt; 조회관리</p></blockquote><h2 id="개요" tabindex="-1">개요 <a class="header-anchor" href="#개요" aria-label="Permalink to &quot;개요&quot;">​</a></h2><p>입주자 정보를 다양한 조건으로 조회합니다. 세대 정보 및 소유주 주거구분을 조회할 수 있으며, 동호를 다양한 방식으로 입주 중 혹은 입주현황으로 이용할 수 있습니다.</p><hr><h2 id="세대마스터관리" tabindex="-1">세대마스터관리 <a class="header-anchor" href="#세대마스터관리" aria-label="Permalink to &quot;세대마스터관리&quot;">​</a></h2><p><img src="'+t+'" alt="세대마스터관리 화면"></p><h3 id="기능-설명" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>세대 정보 및 소유주 주거구분을 조회할 수 있습니다.</p><ul><li>세대마스터관리에서 입주자, 소유주 명을 동시에 확인 및 조회할 수 있습니다.</li><li>동호를 다른방식에서 입주 중 혹은 상세화면으로 이동하여 이용할 수 있습니다.</li></ul><h3 id="주요-기능" tabindex="-1">주요 기능 <a class="header-anchor" href="#주요-기능" aria-label="Permalink to &quot;주요 기능&quot;">​</a></h3><ul><li>세대 기본 정보(입주자, 소유자, 주거구분) 조회 및 수정</li><li>세대별 구성원 정보 확인</li><li>다양한 검색 조건(동, 호, 이름, 입주상태 등)으로 세대 검색</li></ul><hr><h2 id="소유주현황" tabindex="-1">소유주현황 <a class="header-anchor" href="#소유주현황" aria-label="Permalink to &quot;소유주현황&quot;">​</a></h2><h3 id="기능-설명-1" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-1" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>소유주 정보를 조회 및 인쇄합니다.</p><ul><li>동/호별 소유주 현황을 조회합니다.</li><li>조회된 소유주 목록을 인쇄하거나 엑셀로 다운로드할 수 있습니다.</li></ul><hr><h2 id="입주자현황" tabindex="-1">입주자현황 <a class="header-anchor" href="#입주자현황" aria-label="Permalink to &quot;입주자현황&quot;">​</a></h2><p><img src="'+h+'" alt="입주자현황 화면"></p><h3 id="기능-설명-2" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-2" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>입주자 현황 및 선거인 명부 동을 조회 및 인쇄할 수 있습니다.</p><ul><li>전체 입주자 정보를 조회 및 인쇄합니다.</li><li>출력형태를 선택한 후 인쇄하면 수거인 명부 등 입주자 정보 관련 각종 출력물을 인쇄할 수 있습니다.</li></ul><h3 id="출력-양식-종류-선거인명부-등" tabindex="-1">출력 양식 종류 (선거인명부 등) <a class="header-anchor" href="#출력-양식-종류-선거인명부-등" aria-label="Permalink to &quot;출력 양식 종류 (선거인명부 등)&quot;">​</a></h3><ul><li>소유주 명부</li><li>입주자현황 명부</li><li>선거인명부(소유주)</li><li>기타 입주자 관련 출력물</li></ul><hr><h2 id="입주자찾기" tabindex="-1">입주자찾기 <a class="header-anchor" href="#입주자찾기" aria-label="Permalink to &quot;입주자찾기&quot;">​</a></h2><h3 id="기능-설명-3" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-3" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>전화번호 및 성명 등으로 입주자 정보를 검색합니다.</p><ul><li>이름, 연락처 등 다양한 조건으로 입주자를 빠르게 검색합니다.</li></ul><hr><h2 id="입주일별대장" tabindex="-1">입주일별대장 <a class="header-anchor" href="#입주일별대장" aria-label="Permalink to &quot;입주일별대장&quot;">​</a></h2><h3 id="기능-설명-4" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-4" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>입주일별로 대장을 조회 및 인쇄합니다.</p><ul><li>입주일자 기준으로 입주한 세대를 목록으로 조회합니다.</li><li>조회된 목록을 인쇄하여 보관할 수 있습니다.</li></ul><hr><h2 id="단지현황" tabindex="-1">단지현황 <a class="header-anchor" href="#단지현황" aria-label="Permalink to &quot;단지현황&quot;">​</a></h2><h3 id="기능-설명-5" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-5" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>입주/미입주/입주율 등을 비율로 조회 및 인쇄합니다.</p><ul><li>단지 전체 입주 현황을 파악합니다.</li><li>세대별 입주/공실/임차 등의 현황을 한눈에 파악할 수 있습니다.</li></ul><hr><h2 id="키불출현황" tabindex="-1">키불출현황 <a class="header-anchor" href="#키불출현황" aria-label="Permalink to &quot;키불출현황&quot;">​</a></h2><h3 id="기능-설명-6" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-6" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>입주등록에 등록된 키불출일 내역을 조회 및 인쇄합니다.</p><ul><li>세대 키 불출 현황을 관리하고 조회합니다.</li><li>키 발급 일자 기준으로 현황을 확인합니다.</li></ul><hr><h2 id="차량찾기" tabindex="-1">차량찾기 <a class="header-anchor" href="#차량찾기" aria-label="Permalink to &quot;차량찾기&quot;">​</a></h2><h3 id="기능-설명-7" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-7" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>차량번호로 세대를 검색합니다.</p><ul><li>등록된 차량번호를 통해 해당 세대를 빠르게 찾을 수 있습니다.</li></ul><hr><h2 id="가상계좌현황" tabindex="-1">가상계좌현황 <a class="header-anchor" href="#가상계좌현황" aria-label="Permalink to &quot;가상계좌현황&quot;">​</a></h2><p><img src="'+o+'" alt="가상계좌현황 화면"></p><h3 id="기능-설명-8" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-8" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>세대별가상계좌 신청 단지 사용 시 각 세대별 가상계좌를 조회합니다.</p><ul><li>가상계좌를 사용하는 단지에서 세대별 가상계좌 정보를 확인합니다.</li></ul><hr><h2 id="임대료현황" tabindex="-1">임대료현황 <a class="header-anchor" href="#임대료현황" aria-label="Permalink to &quot;임대료현황&quot;">​</a></h2><p><img src="'+n+'" alt="임대료현황 화면"></p><h3 id="기능-설명-9" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-9" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>임대 계약 기간 등록 및 금액을 입력하고 조회합니다.</p><ul><li>임대 세대의 임대료 현황을 조회합니다.</li><li>임대 계약 기간과 금액을 등록하고 관리합니다.</li></ul><hr><h2 id="중간정산서조회" tabindex="-1">중간정산서조회 <a class="header-anchor" href="#중간정산서조회" aria-label="Permalink to &quot;중간정산서조회&quot;">​</a></h2><p><img src="'+s+'" alt="중간정산서조회 화면"></p><h3 id="기능-설명-10" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-10" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>중간정산 내역을 조회 및 인쇄합니다.</p><ul><li>전출 처리 시 발행된 중간정산서를 조회합니다.</li><li>세대별 중간정산 내역을 확인하고 출력할 수 있습니다.</li></ul><hr><h2 id="전출차량조회" tabindex="-1">전출차량조회 <a class="header-anchor" href="#전출차량조회" aria-label="Permalink to &quot;전출차량조회&quot;">​</a></h2><h3 id="기능-설명-11" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-11" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>전출 및 해지차량 내역을 조회합니다.</p><ul><li>전출 처리된 세대의 차량 정보를 조회합니다.</li><li>전출 세대 차량의 등록 해제 현황을 확인할 수 있습니다.</li></ul><hr><h2 id="관련-메뉴" tabindex="-1">관련 메뉴 <a class="header-anchor" href="#관련-메뉴" aria-label="Permalink to &quot;관련 메뉴&quot;">​</a></h2><ul><li><a href="/occp/move-in.html">입주처리</a> - 신규 입주 처리</li><li><a href="/occp/move-out.html">전출처리</a> - 전출 처리</li><li><a href="/occp/vehicle.html">차량관리</a> - 차량 등록 및 관리</li></ul>',76)])])}const k=l(c,[["render",u]]);export{P as __pageData,k as default};
